import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faDesktop } from '@fortawesome/fontawesome-free-solid';
function Icon3() {
	return (
		<div>
			<FontAwesomeIcon className="ic" icon={faDesktop} />
			<div>Development</div>
		</div>
	);
}
export default Icon3;
